window.bookSummaryJSON = "<p><i>Beyond the borders of the Protectorate</i><br> <i>Beyond the eyes of the Royal Martian Navy</i><br> <i>Beyond the reach of the Mage-Queen</i><br> <i>Innocents cry out for help - and Mars will answer!</i></p> <p>When the Royal Martian Navy moved against reports of piracy in the Fringe Systems, the last thing Mage-Commander Roslyn Chambers expected was to find was a malignant remnant of the defeated Republic of Faith and Reason.</p> <p>Now the Royal Martian Navy knows their enemy and their Mage-Queen has charged them to bring the First Legion, conquerors of the hidden colonies beyond the Fringe, to justice. The Legion knows the RMN’s tricks, though, and has cleverly concealed their tracks.</p> <p>As Chambers and the spy Kelly Lamonte sweep distant stars for the trail of their enemies, the fleets of Mars gather behind them - but the fate of millions may lie in the hands of a woman none of them have ever met.</p> <p>A woman the Republic already killed.</p>"; 
